('ihsanfadly@gmail.com', 'R', 'marketing-id@jobstreet.com', 'JobStreet.com Indonesia meraih Excellent Corporate Image Awards 2016', '\r\n\r\n\r\n\r\n \r\n  \r\n  \r\n \r\n  \r\n  \r\n \r\n  \r\n  \r\n  \r\n	\r\n		\r\n		View in web browser\r\n		\r\n	\r\n	\r\n	\r\n\r\n  \r\n    \r\n        \r\n    \r\n    \r\n      JobStreet.com Indonesia meraih\r\n      Excellent Corporate Image Awards 2016*\r\n    \r\n    \r\n      \r\n    \r\n    \r\n      \r\n        \r\n        Dear ikhsan,\r\n    \r\n    \r\n      \r\n        Terima kasih telah menjadikan JobStreet.com sebagai mitra karier Anda untuk mendapatkan peluang karier yang lebih baik.\r\n        \r\n        Setelah berhasil meraih Top Brand Awards 2015 & 2016, JobStreet.com Indonesia kembali meraih penghargaan Excellent Corporate Image Awards 2016, melalui hasil survey Frontier Consulting Group.\r\n        \r\n        JobStreet.com akan terus berkomitmen untuk menyediakan informasi lowongan kerja berkualitas dan terpercaya.\r\n        \r\n        Pastikan data diri, pengalaman kerja dan pendidikan Anda diperbarui secara berkala sehingga meningkatkan peluang Anda dicari perusahaan untuk peluang kerja yang lebih baik. \r\n        \r\n        \r\n    \r\n    \r\n      \r\n    \r\n    \r\n      \r\n        \r\n          \r\n            \r\n               Perbarui profil anda sekarang\r\n            \r\n          \r\n        \r\n        \r\n        \r\n    \r\n    \r\n      \r\n        *Hasil survey Frontier Consulting Group yang dipublikasikan di Majalah Marketing edisi Juni 2016.\r\n        \r\n        \r\n        Salam hangat,\r\n        JobStreet.com        \r\n    \r\n  \r\n  \r\n    \r\n       \r\n          \r\n						  \r\n						 \r\n          \r\n						  \r\n						\r\n          \r\n            \r\n              \r\n                \r\n                Paling Terpercaya\r\n              \r\n            \r\n          \r\n          \r\n						  \r\n						 \r\n          \r\n						  \r\n						\r\n          \r\n            \r\n              \r\n                \r\n                Perusahaan Yang Berkualitas\r\n              \r\n            \r\n          \r\n          \r\n						  \r\n						 \r\n          \r\n						  \r\n						\r\n          \r\n          \r\n            \r\n              \r\n                \r\n                Paling inovatif\r\n              \r\n            \r\n          \r\n          \r\n						  \r\n						 \r\n          \r\n						  \r\n						 \r\n        \r\n    \r\n  \r\n  \r\n    \r\n      \r\n          \r\n          \r\n          App Store \r\n          Google Play \r\n          Facebook \r\n           Terms | Privacy\r\n            © JobStreet.com Indonesia\r\n        \r\n    \r\n  \r\n  \r\n  \r\n \r\n  \r\n  \r\n \r\n  \r\n  \r\n  \r\n \r\n  \r\n  \r\n \r\n  \r\n  \r\n  \r\n \r\n  \r\n  \r\n \r\n  \r\n\r\n* This is not an unsolicited message. To unsubscribe please click here\r\n\r\n\r\n\r\n', '2016-06-28 18:49:51'),
('ihsanfadly@gmail.com', 'R', 'Skillshare <hello@skillshare.com>', 'New This Week: Twitter for Small Business, Blogging Essentials, Fashion Illustration, and More', '\r\n\r\n\r\n	Skillshare | Learning For Creators\r\n	\r\n	\r\n\r\n\r\n\r\n	\r\n		\r\n			\r\n			Check out this week&#39;s top trending Skillshare classes.\r\n			\r\n		\r\n		\r\n			\r\n			\r\n			 Earn Free Months\r\n			\r\n		\r\n		\r\n			\r\n		\r\n		\r\n			\r\n			Free Class: Leveraging Twitter for Small Business\r\n\r\n			Want to grow your brand and customer base? Get ready to learn straight from Twitter! In this 35-minute class, Twitter&#39;s Sandra Vega draws on experiences with thousands of entrepreneurs to share strategies for getting started, growing your following, writing effective tweets, and measuring results &mdash; all to help you reach your business goals.\r\n			Join for Free\r\n		\r\n		\r\n			\r\n		\r\n		\r\n			\r\n			Free Class: Blogging Essentials with Bloglovin&#39;\r\n\r\n			Want to take your blog to the next level, or even start a new one? Join Bloglovin&#39; VP of Community &amp; Support Morgan Kaye for a 20-minute class on growing a successful blog. Packed with tips on content, community, and monetization (working with brands), you&#39;ll learn straightforward ways to turn the blog you love into an authentic, thriving business!\r\n			Join for Free\r\n		\r\n		\r\n			\r\n		\r\n		\r\n			\r\n			Free Class: Drawing Fashion for Fun\r\n\r\n			Join fashion designer LaQuan Smith &mdash; known for outfitting Rihanna, Kim Kardashian, and Beyonc&eacute; &mdash; for a mini class on identifying and sketching a signature piece of clothing that represents you! In 15 minutes, he shares his creative process, approach to fashion, and a fun drawing prompt that&#39;s perfect for fashion lovers, artists, and illustrators alike.\r\n			Join for Free\r\n		\r\n		\r\n			\r\n			Trending Classes\r\n			\r\n			See All\r\n		\r\n		\r\n			\r\n			\r\n			Source &amp; Mix: Digital Collage from Vintage Encyclopaedia Illustr