('ihsanfadly@gmail.com', 'R', 'Skillshare <hello@skillshare.com>', 'Trending for July 4th: BBQ Photography, Tin Can Grill, Watercolor Linens, and More!', '\r\n\r\n\r\n	Skillshare | Learning For Creators\r\n	\r\n	\r\n\r\n\r\n\r\n	\r\n		\r\n			\r\n			Your weekly dose of creative inspiration.\r\n			\r\n		\r\n		\r\n		\r\n		\r\n			\r\n			Skillshare Weekly Digest\r\n			\r\n		\r\n		\r\n			\r\n		\r\n		\r\n			\r\n			First Look: Capture Your July 4th BBQ\r\n\r\n			Hanging with friends for the holiday? Grab your camera and get ready to shoot! Starting today, enroll in a brand-new class with Snapwire photographer Blake Bronstad. You&#39;ll join him and friends for a BBQ in Santa Barbara and gain insider access to tips for shooting, editing, and even selling your images online.\r\n			Join Today\r\n		\r\n		\r\n			\r\n		\r\n		\r\n			\r\n			Custom Envelope Folding\r\n\r\n			Click above to learn how to make your own stationery with a piece of paper and a few well-placed folds!\r\n			\r\n		\r\n		\r\n			\r\n		\r\n		\r\n			\r\n			DIY Watercolor Linens\r\n\r\n			Add some beautiful color to your favorite linens in just a few easy steps.\r\n			\r\n		\r\n		\r\n			\r\n		\r\n		\r\n			\r\n		\r\n		\r\n			\r\n			Easy Tin Can Grill\r\n\r\n			BBQ season is here! Transform a basic tin can into a convenient grill-on-the-go!\r\n			\r\n		\r\n		\r\n			\r\n		\r\n		\r\n			\r\n		\r\n		\r\n			\r\n			Need a Break? Earn Passive Income as a Creative\r\n\r\n			Looking to earn more money despite a packed schedule? Here are some of the best tips to maximize your passive income today.\r\n			Learn More\r\n		\r\n		\r\n			\r\n			Don&#39;t want to receive these emails anymore? Unsubscribe\r\n			Skillshare, 210 Elizabeth Street, New York NY 10012\r\n			\r\n		\r\n		\r\n			 \r\n		\r\n	\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '2016-07-04 04:01:51'),
